def run(value_list):
    """
    Calculates the average amount of total expected charges per segment.

    Args:
        value_list: A list of dictionaries, where each dictionary represents a value with its attributes.

    Returns:
        A tuple containing the average total expected charges and the scale.
    """
    total_expected_charges = {}
    segment_counts = {}

    for item in value_list:
        if item['category'] == 'Total':
            total_expected_charges[item['header2']] = float(item['number_value'])
            segment_counts[item['category']] = 1
        else:
            if item['header2'] == 'Total Expected Charges':
                if item['category'] not in total_expected_charges:
                    total_expected_charges[item['category']] = 0.0
                total_expected_charges[item['category']] += float(item['number_value'])
                if item['category'] not in segment_counts:
                    segment_counts[item['category']] = 0
                segment_counts[item['category']] += 1

    average_charges = {}
    for segment, total in total_expected_charges.items():
        average_charges[segment] = total / segment_counts[segment]

    average_value = sum(average_charges.values()) / len(average_charges)

    return (round(average_value, 2), 'million')

