    """

    financing_costs_2018 = 0
    financing_costs_2019 = 0
    count = 0

    for item in value_list:
        if item['header2'] == '2018' and item['category'] == 'Financing costs':
            financing_costs_2018 += item['number_value']
            count += 1
        elif item['header2'] == '2019' and item['category'] == 'Financing costs':
            financing_costs_2019 += item['number_value']
            count += 1

    if count == 0:
        return (0.0, '')

    average_financing_costs = (financing_costs_2018 + financing_costs_2019) / count

    return (round(average_financing_costs, 2), '')

def run(value_list):
    """
    Calculates the difference between the average investment income and average financing costs.

    Args:
        value_list: A list of dictionaries, where each dictionary contains financial data.

    Returns:
        A tuple containing the difference (float with two decimal places) and the scale (string).
    """

    investment_income_values = []
    financing_costs_values = []

    for item in value_list:
        if item['category'] == 'Investment income':
            investment_income_values.append(float(item['number_value']))
        elif item['category'] == 'Financing costs' or item['category'] == 'Net financing costs':
            financing_costs_values.append(float(item['number_value']))

    if not investment_income_values or not financing_costs_values:
        return (0.0, '')

    avg_investment_income = sum(investment_income_values) / len(investment_income_values)
    avg_financing_costs = sum(financing_costs_values) / len(financing_costs_values)

    difference = avg_investment_income - avg_financing_costs

    return (round(difference, 2), '')

