def run(value_list):
    """
    Calculates the change in total personnel expenses from 2018 to 2019.

    Args:
        value_list: A list of dictionaries, where each dictionary represents a financial value.

    Returns:
        A tuple containing the change in total personnel expenses and the scale.
    """
    total_2018 = 0
    total_2019 = 0

    for item in value_list:
        if item['category'] == 'Total' and item['header1'] == '2018':
            total_2018 = item['number_value']
        elif item['category'] == 'Total' and item['header1'] == '2019':
            total_2019 = item['number_value']

    change = total_2019 - total_2018

    if change == 0:
        scale = ""
    elif change < 1000:
        scale = ""
    elif change < 1000000:
        scale = "thousand"
    elif change < 1000000000:
        scale = "million"
    elif change < 1000000000000:
        scale = "billion"
    else:
        scale = "trillion"

    return (float(change), scale)

