    total_revenue_2018 = 0

    for item in value_list:
        if item['category'] == 'Total Marine Services segment revenue' and item['header1'] == '2019':
            total_revenue_2019 = float(item['number_value'])
        elif item['category'] == 'Total Marine Services segment revenue' and item['header1'] == '2018':
            total_revenue_2018 = float(item['number_value'])

    if total_revenue_2019 > 0 and total_revenue_2018 > 0:
